import React from 'react';
import Department_Image from '~/Assets/GCET_BUILD.jpg';
import './Home.css';

const Home = () =>{
  return (
    <div className='Home'>
      <>
      <h3>Home!!</h3>
      <Card/>
      </>
    </div>
  );
}

class CardBody extends React.Component {
  render() {
    return (
      <div className="card-body">
        <p className="date">March 20 2015</p>
        
        <h2>{this.props.title}</h2>
        
        <p className="body-content">{this.props.text}</p>
        
      </div>
    )
  }
}

class CardHeader extends React.Component {
  render() {
    const { image } = this.props;
    var style = { 
        backgroundImage: 'url(' + image + ')',
    };
    return (
      <header style={style} id={image} className="card-header">
        <h4 className="card-header--title">News</h4>
      </header>
    )
  }
}
class Button extends React.Component {
  render() {
    return (
      <button className="button button-primary">
        <i className="fa fa-chevron-right"></i> Find out more
      </button>
    )
  }
}
class Card extends React.Component {
  render() {
    return (
      <article className="card">
        <CardHeader image={'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse2.mm.bing.net%2Fth%3Fid%3DOIP.5pLooBiM2zqbCXBE-bNbcwAAAA%26pid%3DApi&f=1'}/>
        <CardBody title={'Deparments'} />
      </article>
    )
  }
}

export default Home;
